import React from 'react';
import cls from '../hisob.module.scss'
import {Link} from "react-router-dom";
import {CopyIcon} from "../../../assets/icons";

const HisobTasdiqlash = () => {
    return (
        <div className={cls.hisob}>
            <div className="container" style={{padding: '0'}}>
                <div className={cls.head}>
                    <Link className={cls.head__link} to='/savdo'>
                        <i className="fa-solid fa-chevron-left"/>
                    </Link>
                    <h2 className={cls.head__title}>HISOBNI TO’LDIRISH</h2>
                </div>
                <div className={cls.body}>
                    <div className={cls.body__inner}>
                        <div className={cls.body__inp}>
                            <span className={cls.body__inp_txt}>{ 'IU7g6f98g97G86WFGX7YVY9X' }</span>
                            <CopyIcon />
                        </div>
                        <p className={cls.body__desc2} style={{color: '#FF0000'}}>Tolov qilayotgan usdt adresga etiborli bo’ling faqatgina TRC20  setida yubiring boshqa setda yuborilgan to’lovlar qabul qilinmaydi bekor qilinadi !</p>
                        <input className={cls.body__inp} defaultValue={100} type="number" placeholder='Usdt miqdori'/>
                        <Link className={cls.body__btn} to='/hisob/tasdiqlash'>Keyingi sahifa</Link>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default HisobTasdiqlash;
